configure:
  commands:
    end:
      new_state: execute
    interface TenGigabitEthernet1/2/0/19: "interface TenGigabitEthernet1/2/0/19\r\n"
    ipv6 address fe80:1::1 link-local: "ipv6 address fe80:1::1 link-local\r\n"
    ipv6 enable: "ipv6 enable\r\n"
    ip address 14.1.1.2 255.255.255.0: "ip address 14.1.1.2 255.255.255.0\r\n"
    ip address 14.1.1.3 255.255.255.0 secondary: "ip address 14.1.1.3 255.255.255.0 secondary\r\n"
    ip address 14.1.1.4 255.255.255.0: "ip address 14.1.1.4 255.255.255.0\r\
                                      \n% 14.1.1.0 overlaps with TenGigabitEthernet1/2/0/18\r\
                                      \n% 14.1.1.0 overlaps with TenGigabitEthernet1/2/0/18"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: Stargazer(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Stargazer(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Stargazer#
